window.bookSummaryJSON = "<b><p>Let the games begin.... </p></b> <p><b></b>Runaway Zelda Wilder will do whatever it takes to secure a better life for her and her sister, Ava. Crown Prince Rowan Westringham Tate will do whatever it takes to preserve his small country. </p> <p>\"Playboy Prince\" MacCallum Lockwood Tate will do whatever it takes to steal Zelda's heart.... </p> <p>When Zee is blackmailed into humiliating the brooding future king, she never expects to be pulled into a web of international intrigue - or to fall for Rowan's naughty younger brother, Cal. </p> <p>Cal is determined to capture the sexy player, but Zelda is in over her head with very dangerous men. Time is running out, and it may be too late for the prince to save this player. </p>"; 
